import {useState} from 'react'

const App = () => {
  const [person, setPerson] = useState([
    { name: 'toto le toto' }
  ])
  const [newName, setNewName] = useState('')

  const HandleNameChange = (event) => {
    console.log(event.target.value)
    setNewName(event.target.value)
  }

  function checkName (name) {
    const a = Object.getOwnPropertyNames(name)
    const b = Object.getOwnPropertyNames(this)

    if (a.length !== b.length) return false
    const hasSameKey = a.every(value => !!b.find(v => v === value))
    if (!hasSameKey) return false

    for (const key of a) if (a[key] !== b[key]) return false

    return true
  }

  const AddNote = (event) => {
    event.preventDefault()
    const personObj = {
      name: newName,
    }
    setPerson(person.concat(personObj))
    setNewName('')
  }

  return (
    <div>
      <h2>phonebook</h2>
      <form onSubmit={AddNote}>
        <div>
          name: <input value={newName} onChange={HandleNameChange}/>
        </div>
        <div>
          <button type="submit">add</button>
        </div>
      </form>
      <h2>numbers</h2>
        {person.map(al =>
            <li key={al.name}>{al.name}</li>
        )}
    </div>
  )
}

export default App
